import { makeStyles } from "@mui/styles";


export const useStyles = makeStyles({

    wlbutton : {
        height : '50px',
width : '250px'
    },


    box:{
        display : 'flex',
        flexWrap : 'wrap',
        justifyContent : 'space-between'
    },



    form:{

        marginTop : '50px',
        display: 'flex',
        justifyContent : 'center'
    },

    header:{

        marginTop : '10px',
        marginBottom : '40px',
        display : "flex",
        justifyContent : 'space-between',
    },

    input:{
        width : '50%',

    },
    buttop:{

        height : '50px',
width : '100px'
    },


});
